import logo from './logo.svg';
import './App.css';
import ButtonNav from './component/button'
import MultiButtons from './component/buttons'
import ButtonTwo from './component/buttontwo'
import login from './component/login'
import TextOne from './component/text1'
import Header from './component/header';
import About from './component/images';
import  Parent from './component/main'
import Intro from './component/intro';
import Main from './pages/home';
function App() {
  return (
    <div className="App">
      <Header />
      <Parent />
    <ButtonNav />
    <ButtonTwo />
    <Intro />
    <MultiButtons />
    <TextOne />
    <About />
    </div>
  );
}

export default App;
